namespace RonSijm.FluidHumidifier.Factories.RDS;

public class DBInstanceFactory(string resourceName = null, Action<Humidifier.RDS.DBInstance> factoryAction = null) : ResourceFactory<Humidifier.RDS.DBInstance>(resourceName)
{

    internal List<InnerDBInstanceDBInstanceRoleFactory> AssociatedRolesFactories { get; set; } = [];

    internal List<InnerDBInstanceProcessorFeatureFactory> ProcessorFeaturesFactories { get; set; } = [];

    internal InnerDBInstanceCertificateDetailsFactory CertificateDetailsFactory { get; set; }

    internal InnerDBInstanceEndpointFactory EndpointFactory { get; set; }

    internal InnerDBInstanceMasterUserSecretFactory MasterUserSecretFactory { get; set; }

    protected override Humidifier.RDS.DBInstance Create()
    {
        var dBInstanceResult = CreateDBInstance();
        factoryAction?.Invoke(dBInstanceResult);

        return dBInstanceResult;
    }

    private Humidifier.RDS.DBInstance CreateDBInstance()
    {
        var dBInstanceResult = new Humidifier.RDS.DBInstance
        {
            GivenName = InputResourceName,
        };

        return dBInstanceResult;
    }
    public override void CreateChildren(Humidifier.RDS.DBInstance result)
    {
        base.CreateChildren(result);

        result.AssociatedRoles = AssociatedRolesFactories.Any() ? AssociatedRolesFactories.Select(x => x.Build()).ToList() : null;
        result.ProcessorFeatures = ProcessorFeaturesFactories.Any() ? ProcessorFeaturesFactories.Select(x => x.Build()).ToList() : null;
        result.CertificateDetails ??= CertificateDetailsFactory?.Build();
        result.Endpoint ??= EndpointFactory?.Build();
        result.MasterUserSecret ??= MasterUserSecretFactory?.Build();
    }

} // End Of Class

